import { useState, useEffect } from "react";
import MeetupList from "../components/meetups/MeetupList";

const AllMeetupsPage = () => {
  if (isLoading) {
    return (
      <section>
        <p>Loading...</p>
      </section>
    );
  }

  return (
    <>
      <h1>All Meetups</h1>
      <MeetupList meetups={loadedMeetups} />
    </>
  );
};

export default AllMeetupsPage;
